const block3 = (context, tags, suffix) => html`<${scopeTag("ui5-icon", tags, suffix)} name="${ifDefined(context.standardIconName)}" class="ui5-message-strip-icon"></${scopeTag("ui5-icon", tags, suffix)}>`;
const block4 = (context, tags, suffix) => html`<${scopeTag("ui5-button", tags, suffix)} icon="decline" design="Transparent" class="ui5-message-strip-close-button" ._buttonAccInfo="${ifDefined(context.accInfo.button)}" @click=${context._closeClick}></${scopeTag("ui5-button", tags, suffix)}>`;


